AUI.add("aui-arraysort",function(a){ASort=a.ArraySort;a.mix(ASort,{compareIgnoreWhiteSpace:function(d,c,g,f){var e;f=f||ASort.compare;if((d==="")&&(c==="")){e=0;}else{if(d===""){e=1;}else{if(c===""){e=-1;}else{e=f.apply(this,arguments);}}}return e;},stableSort:function(e,d){var c,b=e.length;for(c=0;c<b;c++){e[c]={index:c,value:e[c]};}e.sort(function(h,g){var f=d.call(e,h.value,g.value);return(f===0)?(h.index-g.index):f;});for(c=0;c<b;c++){e[c]=e[c].value;}}});},"@VERSION@",{skinnable:false,requires:["arraysort"]});